sys_variable_value.value:
(function execute(inputs, outputs) {

    var competitors = inputs.competitors
    gs.info(competitors)
    var racers = [];

    // Check if competitors is a string or a GlideRecord
    if (typeof competitors === 'string') {
        // If it's a string, split it into an array of sys_ids
        racers = competitors.split(',');
    } else if (competitors instanceof GlideRecord) {
        // If it's a GlideRecord, loop through and extract sys_ids
        while (competitors.next()) {
            racers.push(competitors.toString());
        }
    }

    // If racers were found, pair them sequentially
    var reorderedRacers = [];
    for (var i = 0; i < racers.length; i += 2) {
        if (i + 1 < racers.length) {
            reorderedRacers.push(racers[i], racers[i + 1]);
        } else {
            reorderedRacers.push(racers[i]); // Add last racer if odd count
        }
    }

    // Output the paired racers as a JSON string
    outputs.data = JSON.stringify(reorderedRacers);

})(inputs, outputs);

